import axios from 'axios';
import React, { useState } from 'react';


const AddBook = () => {
    const [title, setTitle] = useState('')
    const [image, setImage] = useState('')
    const [descr, setDescr] = useState('')
    return (
        <div>
                <form>
                    <div className="mb-3">
                        <label htmlFor="title" className="form-label">Title</label>
                        <input type="text" className="form-control" id="title" name='title'/>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="descr" className="form-label">Description</label>
                        <input type="text" className="form-control" id="descr" name='descr'/>
                    </div>
                    <div className="mb-3">
                        <label htmlFor ="image" className="form-label">Image URL</label>
                        <input type="text" className="form-control" id="image" name='image'/>
                    </div>
                    <button type="submit" className="btn btn-primary" onChange={e => setTitle()}>Submit</button>
                </form>
        </div>
    );
}

export default AddBook;
